import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

export default function RoomIcon() {
    return (
        <View style={styles.RoomIconContainer}>
            <Text>Hello</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    RoomIconContainer: {
        backgroundColor: '#fff',
        borderRadius: 25,
        minWidth: 50,
        minHeight: 50,
        maxWidth: 50,
        maxHeight: 50,
        zIndex: 200
    }
})
